import "../style.css";
function Text(props) {
  return (
    <div>
      <p class="tit">Expand your career opportunities with Python</p>
      <p class="pht">Take one of Udemy’s range of Python courses and learn how to code using this incredibly useful language. Its simple syntax and readability makes Python perfect for Flask, Django, data science, and machine learning. You’ll learn how to build everything from games to sites to apps. Choose from a range of courses that will appeal to both beginners and advanced developers alike.</p>
    </div>
  );
}

export default Text;
